New_Business_Amount__c.calculatedFormula:
/* old formula IF( ISPICKVAL( Business_Type__c , "Renewal") ,  UnitPrice -  Previous_Contract_Value__c , UnitPrice) */
IF( 
	Previous_Annual_Value__c = 0
	, Annual_Value__c
	, IF (
			AND(
				ISPICKVAL( Business_Type__c , "Renewal")
				, (Annual_Value__c - Previous_Annual_Value__c) >= 0  
			) 
			, (Annual_Value__c - Previous_Annual_Value__c) 
			, 0
		)
)
